import { jsPDF } from "jspdf";
var normal =
  "";
var bold =
  "";
var callAddFont = function () {
  this.addFileToVFS("SourceSansProRegular-normal.ttf", normal);
  this.addFileToVFS("SourceSansPro-SemiBold-bold.ttf", bold);
  this.addFont("SourceSansProRegular-normal.ttf", "SourceSansPro", "normal");
  this.addFont("SourceSansPro-SemiBold-bold.ttf", "SourceSansPro", "bold");
};
jsPDF.API.events.push(["addFonts", callAddFont]);

export const addSourceSansPro = () => {
  jsPDF.API.events.push(["addFonts", callAddFont]);
};
